

CREATE TABLE `aps_goods` (
  `id` bigint NOT NULL AUTO_INCREMENT COMMENT 'ID 自增',
  `goods_name` varchar(255) DEFAULT NULL COMMENT '商品名称',
  `goods_remark` varchar(255) DEFAULT NULL COMMENT '商品备注',
  `tenant_id` bigint DEFAULT NULL COMMENT '租户ID',
  `is_delete` tinyint(1) DEFAULT '0' COMMENT '是否删除 0 否,1 是',
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `create_by` bigint DEFAULT NULL COMMENT '创建人',
  `update_time` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '修改时间',
  `update_by` bigint DEFAULT NULL COMMENT '修改人',
  `trace_id` varchar(255) DEFAULT NULL COMMENT '调用链路',
  `supplier_status` varchar(255) DEFAULT NULL,
  `version_num` int DEFAULT '0' COMMENT '版本号',
  `factory_id` bigint DEFAULT NULL COMMENT '工厂ID',
  `process_path_id` bigint DEFAULT NULL COMMENT '工艺路线',
  PRIMARY KEY (`id`),
  KEY `idx_aps_goods_tenant_id` (`tenant_id`) USING BTREE,
  KEY `idx_aps_goods_factory_id` (`factory_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=1796458371289751554 COMMENT='aps 商品表';

CREATE TABLE `aps_goods_bom` (
  `id` bigint NOT NULL AUTO_INCREMENT COMMENT 'ID 自增',
  `goods_id` bigint DEFAULT NULL COMMENT '商品ID',
  `bom_code` varchar(255) DEFAULT NULL COMMENT 'bom 编码',
  `bom_name` varchar(255) DEFAULT NULL COMMENT 'bom 名称',
  `bom_usage` smallint DEFAULT NULL COMMENT '使用量',
  `bom_unit` varchar(255) DEFAULT NULL COMMENT '单位',
  `bom_cost_price` mediumint DEFAULT NULL COMMENT '成本价',
  `bom_cost_price_unit` varchar(255) DEFAULT NULL COMMENT '单位',
  `bom_use_work_station` bigint DEFAULT NULL COMMENT '使用工位',
  `bom_use_expression` varchar(255) DEFAULT NULL COMMENT '使用表达式',
  `factory_id` bigint DEFAULT NULL COMMENT '工厂ID',
  `tenant_id` bigint DEFAULT NULL COMMENT '租户ID',
  `is_delete` tinyint(1) DEFAULT '0' COMMENT '是否删除 0 否,1 是',
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `create_by` bigint DEFAULT NULL COMMENT '创建人',
  `update_time` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '修改时间',
  `update_by` bigint DEFAULT NULL COMMENT '修改人',
  `trace_id` varchar(255) DEFAULT NULL COMMENT '调用链路',
  `version_num` int DEFAULT '0' COMMENT '版本号',
  `bom_inventory` int DEFAULT '0' COMMENT '库存',
  PRIMARY KEY (`id`),
  KEY `idx_aps_goods_bom_goods_id` (`goods_id`) USING BTREE,
  KEY `idx_aps_goods_bom_factory_id` (`factory_id`) USING BTREE,
  KEY `idx_aps_goods_bom_tenant_id` (`tenant_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=1797276634345140227 COMMENT='BOM 清单';

CREATE TABLE `aps_goods_forecast` (
  `id` bigint NOT NULL AUTO_INCREMENT COMMENT 'ID 自增',
  `goods_id` bigint DEFAULT NULL COMMENT '商品ID',
  `forecast_no` varchar(255) DEFAULT NULL COMMENT '预测编码',
  `forecast_name` varchar(255) DEFAULT NULL COMMENT '预测名称',
  `forecast_begin_date` varchar(255) DEFAULT NULL COMMENT '开始时间',
  `forecast_end_date` varchar(255) DEFAULT NULL COMMENT '结束时间',
  `tenant_id` bigint DEFAULT NULL COMMENT '租户ID',
  `is_delete` tinyint(1) DEFAULT '0' COMMENT '是否删除 0 否,1 是',
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `create_by` bigint DEFAULT NULL COMMENT '创建人',
  `update_time` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '修改时间',
  `update_by` bigint DEFAULT NULL COMMENT '修改人',
  `trace_id` varchar(255) DEFAULT NULL COMMENT '调用链路',
  `version_num` int DEFAULT '0' COMMENT '版本号',
  `month` varchar(255) DEFAULT NULL,
  `months` text,
  `forecast_status` tinyint DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `idx_aps_goods_forecast_goods_id` (`goods_id`) USING BTREE,
  KEY `idx_aps_goods_forecast_tenant_id` (`tenant_id`) USING BTREE
) ENGINE=InnoDB COMMENT='预测表';

